import React from 'react';
import { HashRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './frontend/pages/Home/Home';

import NotFound from '/Users/vincentman/Desktop/the-cerulean-project/src/frontend/Components/Not-Found/Not-Found.js';
import Navbar from './Users/vincentman/Desktop/the-cerulean-project/src/frontend/Components/Navbar/Navbar.js';
// import Footer from '/Users/vincentman/Desktop/the-cerulean-project/src/frontend/Components/Footer/Footer.js';

import './App.scss';

// import JavaScript from './pages/javascript/javascript';
// import ReactPage from './pages/react/react.js';
// import CSS from './pages/css/css.js';



class App extends React.Component {

  render() {
    return (
      <>
        <Router>
          <div className='App'>
            <div>
              <Navbar />
              <Switch>
                <Route exact path='/' component={Home} />
                {/* <Route exact path='/contact' component={Home} /> */}
                <Route exact path='/Not-Found' component={NotFound} />
                {/* <Route exact path='/javascript' component={JavaScript} />
                <Route exact path='/react' component={ReactPage} />
                <Route exact path='/css' component={CSS} /> */}
              </Switch>
              {/* <Footer /> */}
            </div>
          </div>
        </Router>
      </>
    );
  }
}

export default App;
